import { SlogunSection, SlogunSmall, SlogunBig } from "./styledComponent";

function Slogun() {
  return (
    <SlogunSection>
      <SlogunBig>우리가 하는 것 </SlogunBig>
      <SlogunSmall>이거이거 이거이거 진행한다.</SlogunSmall>
    </SlogunSection>
  );
}

export default Slogun;
